AdGroupRetargetingListServiceExcludedType:
  type: string
  nullable: true
  enum:
  - INCLUDED
  - EXCLUDED
  - UNKNOWN
  title: AdGroupRetargetingListServiceExcludedType
  description: |
    <div lang="ja">AdGroupRetargetingListServiceExcludedTypeは、配信対象、および除外対象の設定を表します。<br>
    このフィールドは省略可能となります。</div>
    <div lang="en">AdGroupRetargetingListServiceExcludedType selects the setting type which delivers ads or do not deliver ads.<br>
    This field is optional.</div>
    <hr>
    <p>* <code>INCLUDED</code> - <span lang="ja">配信対象です。</span><span lang="en">Ads to be delivered</span></p>
    <p>* <code>EXCLUDED</code> - <span lang="ja">除外対象です。</span><span lang="en">Ads not to be delivered</span></p>
    <p>* <code>UNKNOWN</code> - <span lang="ja">未知の値です。</span><span lang="en">Unknown Value</span></p>
